import React from 'react'
import {Button, Row, Col} from 'react-bootstrap'
import NewAccom from './NewAccom.js'


export default function AccomCard(props) {
    return (
        <div>
            {props.location} <br/> 
            {props.date} <br/>
            <Icon name='remove' size='small' onClick={() => this.props.collabDelete(this.props.collaborator)} /><br/>

            <Button onClick={() => props.accomDelete(props.accommodation)} > Delete Accommodation </Button>

        </div>
    )
}
